import Katie from './images/katie-zaferes.png'
import Star from './images/star.png'

function Card () {
    return(
        <div className='card'>
            <img src={Katie} alt="Katie Zaferes" />
            <img src={Star} alt="Star Icon" />
        </div>
    )
}

export default Card
